sympy.sympy.core._print_helpers.__str__:
def __str__(self):
    from sympy.printing.str import sstr
    return sstr(self, order=None)

sympy.sympy.core.decorators._func:
@wraps(func)
def _func(self, other):
    # XXX: The check for _op_priority here should be removed. It is
    # needed to stop mutable matrices from being sympified to
    # immutable matrices which breaks things in quantum...
    if not hasattr(other, '_op_priority'):
        try:
            other = sympify(other, strict=True)
        except SympifyError:
            return retval
    if not isinstance(other, expectedcls):
        return retval
    return func(self, other)

sympy.sympy.core.decorators.__sympifyit_:
@wraps(func)
def __sympifyit_wrapper(a, b):
    try:
        # If an external class has _op_priority, it knows how to deal
        # with SymPy objects. Otherwise, it must be converted.
        if not hasattr(b, '_op_priority'):
            b = sympify(b, strict=True)
        return func(a, b)
    except SympifyError:
        return retval

sympy.sympy.core.expr.__int__:
def __int__(self) -> int:
    if not self.is_number:
        raise TypeError("Cannot convert symbols to int")
    if not self.is_comparable:
        raise TypeError("Cannot convert non-comparable expression to int")
    r = self.round(2)
    if not r.is_Number:
        raise TypeError("Cannot convert complex to int")
    if r in (S.NaN, S.Infinity, S.NegativeInfinity):
        raise TypeError("Cannot convert %s to int" % r)
    i = int(r)
    if not i:
        return i
    if int_valued(r):
        r = self.round(15)
        i = int(r)
    if int_valued(r):
        # non-integer self should pass one of these tests
        if (self > i) is S.true:
            return i
        if (self < i) is S.true:
            return i - 1
        ok = self.equals(i)
        if ok is None:
            raise TypeError('cannot compute int value accurately')
        if ok:
            return i
        # off by one
        return i - (1 if i > 0 else -1)
    return i

sympy.sympy.core.numbers.__sub__:
def __sub__(self, other):
    if global_parameters.evaluate:
        if isinstance(other, int):
            return Integer(self.p - other)
        elif isinstance(other, Integer):
            return Integer(self.p - other.p)
        elif isinstance(other, Rational):
            return Rational._new(self.p*other.q - other.p, other.q, 1)
        return Rational.__sub__(self, other)
    return Rational.__sub__(self, other)

sympy.sympy.core.traversal._preorder_tra:
def _preorder_traversal(self, node, keys):
    yield node
    if self._skip_flag:
        self._skip_flag = False
        return
    if isinstance(node, Basic):
        if not keys and hasattr(node, '_argset'):
            # LatticeOp keeps args as a set. We should use this if we
            # don't care about the order, to prevent unnecessary sorting.
            args = node._argset
        else:
            args = node.args
        if keys:
            if keys != True:
                args = ordered(args, keys, default=False)
            else:
                args = ordered(args)
        for arg in args:
            yield from self._preorder_traversal(arg, keys)
    elif iterable(node):
        for item in node:
            yield from self._preorder_traversal(item, keys)

sympy.sympy.physics.units.dimensions.__s:
def __str__(self):
    """
    Display the string representation of the dimension.
    """
    if self.symbol is None:
        return "Dimension(%s)" % (self.name)
    else:
        return "Dimension(%s, %s)" % (self.name, self.symbol)
